import { Switch, Route } from "react-router-dom";
import Home from "./components/home/home";
import Login from "./components/forms/login";
import SignUp from "./components/forms/signup";
import HomeUsuario from "./components/usuarios/home";
import Session from "./components/session/session"

const App = () => {
  return (
    <div>
      <Switch>
        <Route
          exact
          path="/"
          render={() => {
            return <Home></Home>;
          }}
        />
        <Route 
        exact path="/loginVet" render={()=>{
          return <Login rol="true"></Login>
        }}
        />
        <Route 
        exact path="/loginUsuario" render={()=>{
          return <Login rol="false"></Login>
        }}
        />
        <Route
        exact path="/signup" render={()=>{
          return <SignUp></SignUp>
        }}
        />
         <Route
        exact path="/home" render={()=>{
          return <HomeUsuario></HomeUsuario>
        }}
        />
 <Route
        exact path="/sessionUsuario" render={()=>{
          return <Session></Session>
        }}
        />
      </Switch>
    </div>
  );
};

export default App;
